import React from 'react';
import { Link,NavLink } from 'react-router-dom';

const Navbar=()=>{

return(

    <>
        <ul>
        <NavLink activeClassName="active_class" to='/about' >AboutUs</NavLink > &nbsp;
        <NavLink  to='/contact'>ContactUs</NavLink >&nbsp;

  <li><a href="#about">About</a></li>
</ul>




    </>
)


}



export default Navbar;
